// src/App.js

import React from 'react';
import SearchBar from './SearchBar'; // Import the SearchBar component
import ChatIcon from './ChatIcon'; // Import the ChatIcon component
import './App.css'; // Import your CSS file for styling
import './Chatbot.css'; 


function App() {
    const handleSearch = (query) => {
        console.log('Searching for:', query); // Handle search logic here
    };

    return (
        <div className="BOT">
            <img src={`${process.env.PUBLIC_URL}/background14.jpeg`} alt="logo" style={{ width: '60px', height: '60px' }} />

            <SearchBar onSearch={handleSearch} />
            <ChatIcon />
        </div>
    );
}

export default App;
